41\u043a\u0438\u0439, \u0410\u043d\u0430\u0442\u043e\u043b\u0438\u0439 \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0438\u0447\">\u041b\u0443\u043d\u0430\u0447\u0430\u0440\u0441\u043a\u0438\u043c<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D0%BD%D0%B8%D1%81%D0%BB%D0%B0%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0442\u0430\u043d\u0438\u0441\u043b\u0430\u0432\u0441\u043a\u0438\u0439, \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u0421\u0442\u0430\u043d\u0438\u0441\u043b\u0430\u0432\u0441\u043a\u0438\u043c<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87-%D0%94%D0%B0%D0%BD%D1%87%D0%B5%D0%BD%D0%BA%D0%BE,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041d\u0435\u043c\u0438\u0440\u043e\u0432\u0438\u0447-\u0414\u0430\u043d\u0447\u0435\u043d\u043a\u043e, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u041d\u0435\u043c\u0438\u0440\u043e\u0432\u0438\u0447\u0435\u043c-\u0414\u0430\u043d\u0447\u0435\u043d\u043a\u043e<\/a> \u0438 \u0434\u0440.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929\" class=\"mw-redirect\" title=\"1929\">1929<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D1%91%D1%80%D0%BD%D1%8B%D0%B9_%D1%87%D0%B5%D1%82%D0%B2%D0%B5%D1%80%D0%B3_(1929)\" class=\"mw-redirect\" title=\"\u0427\u0451\u0440\u043d\u044b\u0439 \u0447\u0435\u0442\u0432\u0435\u0440\u0433 (1929)\">\u0427\u0451\u0440\u043d\u044b\u0439 \u0447\u0435\u0442\u0432\u0435\u0440\u0433<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e \u0431\u0438\u0440\u0436\u0435\u0432\u043e\u0433\u043e \u043a\u0440\u0430\u0445\u0430 1929 \u0433\u043e\u0434\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935\" class=\"mw-redirect\" title=\"1935\">1935<\/a>&#160;\u2014 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B0%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D0%B0%D1%88%D0%BD%D1%8F_(%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0)\" class=\"mw-redirect\" title=\"\u0421\u043f\u0430\u0441\u0441\u043a\u0430\u044f \u0431\u0430\u0448\u043d\u044f (\u041c\u043e\u0441\u043a\u0432\u0430)\">\u0421\u043f\u0430\u0441\u0441\u043a\u043e\u0439 \u0431\u0430\u0448\u043d\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%9A%D1%80%D0%B5%D0%BC%D0%BB%D1%8C\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u041a\u0440\u0435\u043c\u043b\u044c\">\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u041a\u0440\u0435\u043c\u043b\u044f<\/a> \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430 \u043c\u0435\u0434\u043d\u0430\u044f \u0437\u0432\u0435\u0437\u0434\u0430, \u0438\u0437\u0433\u043e\u0442\u043e\u0432\u043b\u0435\u043d\u043d\u0430\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BD%D0%B5%D1%86%D0%BA%D0%B8%D0%B9_%D1%83%D0%B3%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B1%D0%B0%D1%81%D1%81%D0%B5%D0%B9%D0%BD\" title=\"\u0414\u043e\u043d\u0435\u0446\u043a\u0438\u0439 \u0443\u0433\u043e\u043b\u044c\u043d\u044b\u0439 \u0431\u0430\u0441\u0441\u0435\u0439\u043d\">\u0414\u043e\u043d\u0431\u0430\u0441\u0441\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939\" class=\"mw-redirect\" title=\"1939\">1939<\/a><ul><li>\u0412\u043f\u0435\u0440\u0432\u044b\u0435 \u043a\u043e\u0440\u043f\u043e\u0440\u0430\u0446\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/DuPont\" title=\"DuPont\">DuPont<\/a> \u043f\u0443\u0441\u0442\u0438\u043b\u0430 \u0432 \u043f\u0440\u043e\u0434\u0430\u0436\u0443 \u043d\u0435\u0439\u043b\u043e\u043d\u043e\u0432\u044b\u0435 \u0447\u0443\u043b\u043a\u0438 (\u0423\u0438\u043b\u043c\u0438\u0